    <Cards  
    imgsrc ={Sdata[0].imgsrc}
    title = {Sdata[0].title}
    sname = {Sdata[0].sname}
    links = {Sdata[0].links}
/>
}
ReactDom.render(

    <>
      <h1 className="heading_style">List of 6 Netflix Best Series </h1>




